    findLimits:function(array,param){
        //var dim=[[10000000,-100000000],[10000000,-100000000],[10000000,-100000000]];
        var ncv=param.cv.length;
        if(!param.cv[0].max){
            for(var j=0;j<ncv;j++){
                param.cv[j].min=10000000;
                param.cv[j].max=-10000000;
            }
            for(var i=0;i<array.length;i+=ncv+1){
                for(var j=0;j<ncv;j++){
                    var val=array[i+j];
                    var cv=param.cv[j];
                    cv.min=Math.min(val,cv.min);
                    cv.max=Math.max(val,cv.max);
                }
            }
        }
        for(var i=0;i<ncv;i++){
            var cv=param.cv[i];
            if(Math.abs(cv.min+Math.PI)<0.1){cv.min=-Math.PI;cv.period=true;}
            if(Math.abs(cv.max-Math.PI)<0.1){cv.max= Math.PI;cv.period=true;}
            if(!cv.period){cv.max+=2*cv.sigma;cv.min-=2*cv.sigma;}
        }
        return param;
        //return {sigma:param.sigma,dimx:dim[0],dimy:dim[1],period:period,movhill:param.movhill,cv:param.cv};
    },
    readData:function(data,stamps,stamdata,param){
        //var times=[];
        var times=new Float32Array(stamps.length*2);
        var ndata=new Float32Array(data.length);
        stamps=stamps.sort(function(a,b){return a-b;});
        var counter=0;
        var CV=param.cv.length;
        for(var i=0;i<stamps.length;i++){
            var stamp=stamps[i];
            var pois=stamdata[stamp];
            times[i*2]=stamp;
            times[i*2+1]=counter;
            for(var j=0;j<pois.length;j++){
                var poi=pois[j];
                for(var k=0;k<=CV;k++){
                    ndata[counter+k]=data[poi+k];
                }
                counter+=CV+1;
            }
        }
        graf.databuf=ndata.buffer;
        graf.data=ndata;
        graf.loadPar(param);
        graf.slide.load(times,{min:stamps[0],max:stamps[stamps.length-1]});
        graf.slide.reset();
        
        main.createAxis();
        main.cons("data loaded");
    },
    createAxis:function(){
        if(!this.axis){
            this.axis=this.div.axis[0].getContext("2d");
        }else{
            this.axis.clearRect(0,0,this.height+30,this.width+30);
        }
        var ctx=this.axis;
        ctx.strokeStyle="black";
        ctx.lineWidth=3;
        ctx.beginPath();
        ctx.moveTo(26,0);
        ctx.lineTo(26,main.height+4);
        ctx.lineTo(main.width+30,main.height+4);
        ctx.stroke();
        ctx.lineWidth=0.5;
        ctx.strokeStyle="black";
        ctx.beginPath();
        var kx=0.1,px=1;
        var ky=0.1,py=1;
        var cv0=graf.param.cv[0];
        var cv1=graf.param.cv[1];
        while(cv0.span>=100*kx){kx*=10;px=0;}
        if(cv0.span>=30*kx){kx*=3;}
        while(cv1.span>=100*ky){ky*=10;py=0;}
        if(cv1.span>=30*ky){ky*=3;}
        for(var i=Math.ceil(cv0.min);i<cv0.max;i+=kx){
            var pos=graf.toPos([i,0],0,2);
            pos=[Math.floor(pos[0])+0.5,Math.floor(pos[1])+0.5];
            //this.cons(pos[0]+" "+pos[1])
            ctx.moveTo(30+pos[0],0);
            ctx.lineTo(30+pos[0],main.height);
            ctx.fillText(i.toFixed(px),30+pos[0],main.height+15);
        }
        for(var i=Math.ceil(cv1.min);i<cv1.max;i+=ky){
            var pos=graf.toPos([0,i],0,2);
            pos=[Math.floor(pos[0])+0.5,Math.floor(pos[1])+0.5];
            ctx.moveTo(30,pos[1]);
            ctx.lineTo(30+main.width,pos[1]);
            ctx.fillText(i.toFixed(py),10,pos[1]);
        }
        ctx.stroke();
        
    },
    demez:function(string){
        return string.replace(/[\s\n\t\r]/g,"");
    },
    cons:function(string){
        var txt=this.constext;
        var str="";
        for(var i=19;i>0;i--){
            txt[i]=txt[i-1];
            str=txt[i]+"<br>"+str;
        }
        txt[0]=string;
        this.div.console.html(txt[0]+"<br>"+str);
    }
